import React from "react";

class Stocks extends React.Component {
  constructor() {
    super();
  }

  render() {
    console.log(this.props.stocklists);
    const a = this.props.stocklists.map((stock, index) => (
      <Stocks name={stock.name} key={index} />
    ));
    return (
      <div>
        <p>{a.name}hello</p>
      </div>
    );
  }
}

export default Stocks;
